import React, { useEffect, useState } from 'react'
import { timeAgo } from '../utils/functions'
import { iconsRef } from '../utils/iconsRef'
import gif from '/assets/gifs/clocksWhite.gif'
import { useMessenger } from '../context/MessengerContext'
import { FileEntry } from '../types'

interface MessageProps {
    time: string,
    text?: string,
    isOnLeft: boolean,
    isLast: boolean,
    fileEntry?: FileEntry,
    downloadFile?: (filename: string) => void
}

const MessageFabric: React.FC<MessageProps> = ({ time, text, isOnLeft, isLast, fileEntry, downloadFile }) => {

    if (fileEntry) return <FileMessage time={time} isOnLeft={isOnLeft} isLast={isLast} fileEntry={fileEntry} downloadFile={downloadFile}/>
    return <TextMessage time={time} isOnLeft={isOnLeft} isLast={isLast} text={text} />
}

export default MessageFabric

const TextMessage: React.FC<MessageProps> = ({ time, text, isOnLeft, isLast }) => {
    return (
        <li className={`mt-1 mb-1 p-[8px] ${isOnLeft ? "" : "flex items-end"} flex-col ${isLast && 'pb-10'}`} >
            <section className={`${isOnLeft ? "bg-white text-black" : "bg-black text-white "} p-2 pl-5 pr-5 rounded-3xl inline-block max-w-[400px] break-words text-[25px] shadow-xl`}>
                {text}
            </section>
            <section className={`text-[14px] font-black text-bold pl-3 pr-3 ${isOnLeft ? "" : "flex justify-end"}`}>
                {timeAgo(time)}
            </section>

        </li>
    )
}

const FileMessage: React.FC<MessageProps> = ({ time, isOnLeft, isLast, fileEntry, downloadFile }) => {
    const { expiredFiles } = useMessenger()
    const [expired, setExpired] = useState(false)
    const [timeLeft, setTimeLeft] = useState('');

    useEffect(() => {
        if (!fileEntry) return;

        const timeRemaining = Math.max(0, fileEntry.acceptedAt + 5 * 60 * 1000 - Date.now());
        if (timeRemaining === 0) {
            setExpired(true);
            setTimeLeft('');
            return;
        }

        const updateCountdown = () => {
            const now = Date.now();
            const timeRemaining = fileEntry.acceptedAt + 5 * 60 * 1000 - now;

            if (timeRemaining <= 0) {
                setExpired(true);
                setTimeLeft('');
                clearInterval(interval);
            } else {
                const minutesLeft = Math.floor(timeRemaining / 60000);
                setTimeLeft(`${minutesLeft} m left`);
            }
        };

        updateCountdown(); // Initialize the first value
        const interval = setInterval(updateCountdown, 1000 * 60); // Update every minute

        return () => clearInterval(interval);
    }, [fileEntry]);

    function handleFileDownload() {

    }



    // stupid TS hate you bitch can you see that prewvious if statement? bitch
    if (fileEntry)

        return (
            <li className={`mt-1 mb-1 p-[8px] ${isOnLeft ? "" : "flex items-end"} flex-col ${isLast && 'pb-10'}`} >
                <section className={`${isOnLeft ? "bg-white text-black" : "bg-black text-white "} flex flex-row items-center justify-between p-2 pl-5 pr-5 rounded-3xl inline-block max-w-[400px] break-words text-[25px] shadow-xl relative hover:scale-105 transition-transform duration-300 ease-in-out cursor-pointer`} onClick={(fileEntry.filename)}>
                    <div className='flex flex-row'>
                        <Icon icon={isOnLeft ? iconsRef.fileBlack : iconsRef.fileWhite} />
                        <div className='flex flex-col'>
                            <a>{fileEntry.originalFilename}</a>
                            <a className={`text-[15px] ${isOnLeft ? 'text-[#5c5c5c]' : 'text-[#c9c9c9]'}`}>{fileEntry.size}</a>
                        </div>
                    </div>
                    <div className='flex flex-row align-center items-end justify-center absolute right-2 bottom-2'>
                        {!expired && timeLeft && (
                            <span className={`text-[14px] ${isOnLeft ? 'text-[#5c5c5c]' : 'text-[#c9c9c9]'}`}>
                                {timeLeft}
                            </span>
                        )}
                        <img
                            src={isOnLeft ? iconsRef.clocksBlack : iconsRef.clocksWhite}
                            alt="Clock icon"
                            width={25}
                            height={25}
                            className='ml-2'
                        />
                    </div>
                </section>
                <section className={`text-[14px] font-black text-bold pl-3 pr-3 ${isOnLeft ? "" : "flex justify-end"}`}>
                    {timeAgo(time)}
                </section>
            </li>
        )
    else return <li></li>
}


const Icon = ({ icon, w = 50, h = 50 }: { icon: string; w?: number; h?: number }) => {
    return (
        <img
            src={icon}
            width={w}
            height={h}
            style={{ cursor: 'pointer' }}
        />
    );
};
